import React, { useState } from 'react'

export default function SignUppage() {
    const[empioyee,setEmpolyee]=useState({
        name:"",
        password:""
    })
    const onChangeEmpolyee=(event)=>{
        const{name,value}=event.target
        setEmpolyee(prev=>({...prev,[name]:value}))
    }
  return (
    <div>
        <form>
            <label>name</label>
            <input value={empolyee.name} name='name'></input>
            <label>PassWord</label>
            <input value={empolyee.password} name='password'></input>
            <button>Register</button>
        </form>
    </div>
  )
}
